import React from "react";
import "./Selector.css";

const Selector = (props) => {
    return (
        <div className="selector">
            <select>
                <option value="">Выберите курс</option>
                {
                    props.courses.map((course_number, desc) => (
                    <option value={desc} key={course_number}>
                        {course_number}
                    </option>
                ))
                }
            </select>
        </div>
    );
}

export default Selector;
